import React from 'react'
import { NavLink } from 'react-router-dom'

interface NavIconType {
  link: string,
  icon: string,
  quantity: number
}

export const NavIcon: React.FC<NavIconType> = ({link, icon, quantity}) => {
  return (
    <div>NavIcon</div>
  )
}
